import React from 'react';
import {  /* Link, */ NavLink} from "react-router-dom";



const Navbar = () => {

    return (
        <nav className="nav-wrapper blue">
            <div className="container">
                <div className="left">
                        <a href="/home" className="brand-logo left">Dhiren's React App</a>
                </div>

                <ul className="right">
                    {/* For this link click change url to this path */}

                    <li><NavLink to="/home">Home</NavLink></li> 
                    <li><NavLink to='/PostList'>Posts</NavLink></li>
                    <li><NavLink to='/contact'>Contact</NavLink></li>
                    <li onClick={this.logout.bind(this)} ><NavLink to='javascrit:;'>Logout</NavLink></li>
                </ul>
            </div>
        </nav>
    )
}
export default Navbar
